window.bookSummaryJSON = "<p><b>The Space Team Universe just got a whole lot darker.</b></p> <p>In an alien city torn apart by crooked cops and ruthless criminals, private detective Dan Deadman specializes in cases unusual and bizarre.</p> <p>Sure, he doesn't smell great, and he's technically been dead for quite some time, but if you've got a rampaging Hell-beast tearing up your street, or a portal to another dimension appearing in your bathroom, Dan's your man.</p> <p>After saving a mysterious young woman named Ollie from the clutches of something big, slimy, and unpleasant, Dan gets entangled in a missing child case, a string of grisly murders, and a severed woman's arm that just won't leave him alone.</p> <p>And then there's the demonic entity who'll stop at nothing to get its tentacles on Ollie, even if it means destroying the whole damn planet.</p> <p>Times like these, Dan would give his right nut to be a real detective.</p> <p>If he still had nuts.</p> <p><b>From the world of </b><b><i>Space Team: The Guns of Nana Joan</i></b><b>, </b><b><i>Dial D for Deadman</i></b><b> is the first darkly comedic action adventure novel starring Dan Deadman, Space Detective.</b></p>"; 
